import React, {useEffect, useState} from "react";
import { useDispatch, useSelector } from "react-redux";
import { getPosts } from "../../action/PostAction";
import Cookies from "js-cookie";
import { set } from "mobx";

const HomePage = () => {
    let [posts, setPost] = useState('hyu')    
    const dispatch = useDispatch()
    const lox = useSelector(store => store.Post)
    useEffect (()=> {
        dispatch(getPosts())
        console.log(lox.allPost);
        setPost(lox.allPost)
        console.log(posts);
    },[lox])
    return (
        <>
        {posts.map((hyu)=>{
            return (
                <div key={`${hyu.title}`}>
                    <p> {hyu.title}</p>
                </div>
            )
        })}
        </>
    )
}
export default HomePage
